(426, 60, 'mfn-page-items-seo', '<h2 class="headline__secondary"><span class="first-letter">W</span>elcome</h2>\r\n<h5>THE ROSA</h5>\n\ncenter\n\nno-repeat;center;;\n\ncover-ultrawide\n\nbounceInUp\n\n<img src="http://deegeelab.com/template1/wp-content/uploads/2018/01/DISCOVER.png" alt="DISCOVER"/>\n\ncenter\n\n<p style="margin: -50px 0 5px !important;">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla mauris dolor, gravida a varius blandit, auctor eget purus. Phasellus scelerisque sapien sit amet mauris laoreet, eget scelerisque nunc cursus. Duis ultricies malesuada leo vel aliquet. Curabitur rutrum porta dui eget mollis.</p>\r\n<a href="#"><h6 style="color: #cca972;"><u>ABOUT US</u></h6></a>\n\ncenter\n\nno-repeat;center top;;\n\nauto\n\n<img src="http://deegeelab.com/template1/wp-content/uploads/2018/01/4.jpg" alt="4"/>\n\ncenter\n\n<img src="http://deegeelab.com/template1/wp-content/uploads/2018/01/recipes.png" alt="recipes"/>\n\ncenter\n\nfadeIn\n\n<img src="http://deegeelab.com/template1/wp-content/uploads/2018/01/9.jpg" alt="9"/>\n\nlarge\n\n<img src="http://deegeelab.com/template1/wp-content/uploads/2018/01/2.jpg" alt="2"/>\n\nlarge\n\n<img src="http://deegeelab.com/template1/wp-content/uploads/2018/01/7.jpg" alt="7"/>\n\nlarge\n\n<img src="http://deegeelab.com/template1/wp-content/uploads/2018/01/8.jpg" alt="8"/>\n\nlarge\n\n<img src="http://deegeelab.com/template1/wp-content/uploads/2018/01/menu.png" alt="menu"/>\n\ncenter\n\n<p style="margin: -50px 0 5px;">Vivamus in diam turpis. In condimentum maximus tristique. Maecenas non laoreet odio. Fusce lobortis porttitor purus, vel vestibulum libero pharetra vel. Pellentesque lorem augue, fermentum nec nibh et, fringilla sollicitudin orci. Integer pharetra magna non ante blandit lobortis.</p>\r\n<a href="#"><h6 style="color: #cca972;"><u>VIEW THE FULL MENU</u></h6></a>\n\ncenter\n\nno-repeat;center top;;\n\nauto\n\n<img src="http://deegeelab.com/template1/wp-content/uploads/2018/01/blend.png" alt="blend"/>\n\ncenter\n\n<img src="http://deegeelab.com/template1/wp-content/uploads/2018/01/culinary.png" alt="culinary"/>\n\ncenter\n\n<p style="margin: -50px 0 5px !important;">Vivamus in diam turpis. In condimentum maximus tristique. Maecenas non laoreet odio. Fusce lobortis porttitor purus, vel vestibulum libero pharetra vel. Pellentesque lorem augue, fermentum nec nibh et, fringilla sollicitudin orci. Integer pharetra magna non ante blandit lobortis.</p>\r\n<a href="#"><h6 style="color: #cca972;"><u>MAKE A RESERVATION</u></h6></a>\n\ncenter\n\nno-repeat;center top;;\n\nauto\n\n30px\n\n<img src="http://deegeelab.com/template1/wp-content/uploads/2018/01/3.jpg" alt="3"/>\n\n<img src="http://deegeelab.com/template1/wp-content/uploads/2018/01/bacon-2.jpg" alt="bacon-2"/>\n\n<h4 style="color:white;">Locations</h4>\n\nleft\n\nno-repeat;center top;;\n\nauto\n\n<h6 style="color:white;">376 Van Brunt St.</h6>\r\n<h6 style="color:white;">Brooklyn, NY - 11231</h6>\n\nleft\n\nno-repeat;center top;;\n\nauto\n\n<h6 style="color:white;">25 Union Square West</h6>\r\n<h6 style="color:white;"> New York, NY - 10003</h6>\n\nleft\n\nno-repeat;center top;;\n\nauto\n\n<h4 style="color:white;">Hours</h4>\n\nleft\n\nno-repeat;center top;;\n\nauto\n\n<h6 style="color:white;">Monday - Thursday</h6>\r\n<h6 style="color:white;"> 5:30pm - 10:00pm</h6>\n\nleft\n\nno-repeat;center top;;\n\nauto\n\n<h6 style="color:white;">Friday & Saturday</h6>\r\n<h6 style="color:white;"> 5:30pm - 11:00pm</h6>\n\nleft\n\nno-repeat;center top;;\n\nauto\n\n<h6 style="color:white;">Available for private</h6>\r\n<h6 style="color:white;"> events on Sunday</h6>\n\nleft\n\nno-repeat;center top;;\n\nauto\n\n'),
